import './App.css';

import { Layout, Header, Content, Footer } from 'antd';
import 'antd/dist/antd.css';

function App() {
  return (
    <Layout>
      <Header>Header</Header>
      <Content>Content</Content>
      <Footer>Footer</Footer>
    </Layout>
  );
}

export default App;
